import React, { useEffect, useState } from 'react';
import { getProfiles } from './services/service';

const Main = () => {
    const [data,setData]=useState([]);
    useEffect(()=>{
        getProfiles().then((res)=>{
setData(res);
        });
    },[])
    return (
        <div>
            data.map((item,index)={
                <div>{item.name}</div>
            })
        </div>
    );
};

export default Main;
